<?php
namespace integration;

use connection\DatabaseConnection;

class Item
{
    private string $itemId;
    private string $itemName;
    private string $itemDescription;
    private int $itemCategorie;
    private float $itemPrice;
    private int $itemCurrency;
    private $itemImage;
    
    
    
    private bool $hasSale;
    private float $salePrice;
    private int $itemSaleCurrency;
    
    private array $itemSize;
    private array $itemVarities;
    
    private int $boxWidth;
    private int $boxHeight;
    private int $isVisible;
    
    function __construct() {}
    
    /**
     * 
     * @param string $itemId
     * @param DatabaseConnection $connection
     */
    public function withId(string $itemId, DatabaseConnection $connection) {
        $this->itemId = $itemId;
    }
    
    /**
     * 
     * @param mixed $itemId
     * @param string $itemName
     * @param string $itemDescription
     * @param float $itemPrice
     * @param resource $itemImage
     * @param array $itemVarity
     * @param float $salePrice
     */
    public function withData(string $itemId, string $itemName, string $itemDescription, float $itemPrice, $itemImage, array $itemVarities, bool $hasSale, float $salePrice) {
        // create item by data
        $this->itemId = $itemId;
        $this->itemName = $itemName;
        $this->itemDescription = $itemDescription;
        $this->itemPrice = $itemPrice;
        $this->itemImage = $itemImage;
        $this->itemVarities = $itemVarities;
        $this->hasSale = $hasSale;
        $this->salePrice = $salePrice;
    }
    
    /**
     *
     * @param array $entry
     */
    public function withEntry(array $entry) : self {
        $this->itemId = $entry['itemId'];
        $this->itemName = $entry['itemName'];
        $this->itemDescription = $entry['itemDescription'];
        $this->itemPrice = $entry['itemPrice'];
        $this->itemCurrency = $entry['itemCurrency'];
        $this->itemImage = $entry['itemImage'];
        
        $this->hasSale = $entry['itemHasSale'];
        $this->salePrice = $entry['itemSalePrice'];
        $this->itemSaleCurrency = $entry['itemSaleCurrency'];
        
        $this->boxWidth = $entry['itemBoxWidth'];
        $this->boxHeight = $entry['itemBoxHeight'];
        $this->isVisible = $entry['itemVisible'];
        return $this;
    }
    
    /**
     * 
     * @return int
     */
    function getWidth() : int {
        return $this->boxWidth;
    }
    
    /**
     * 
     * @return int
     */
    function getHeight() : int {
        return $this->boxHeight;
    }
    
    /**
     * 
     * @return string
     */
    function getId() : string {
        return $this->itemId;
    }
    
    /**
     * 
     * @return string
     */
    function getName() : string {
        return $this->itemName; // return fetched name of item
    }
    
    /**
     * 
     * @return string
     */
    function getDescription() : string {
        return $this->itemDescription;
    }
    
    /**
     * 
     * @return float
     */
    function getPrice() : float {
        return $this->itemPrice;
    }
    
    /**
     * 
     * @return resource|array
     */
    function getImage() {
        return $this->itemImage;
    }
    
    /**
     * 
     * @return array
     */
    function getVarities() : array {
        return $this->itemVarities;
    }
    
    /**
     * 
     * @return bool
     */
    function hasSale() : bool {
        return $this->hasSale;
    }
    
    /**
     * 
     * @param string $itemName
     * @return self
     */
    function setName(string $itemName) : self {
        $this->itemName;
    }
    
    /**
     * 
     * @param string $itemDescription
     * @return self
     */
    function setDescription(string $itemDescription) : self {
        $this->itemDescription;
    }
    
    /**
     * 
     * @param float $itemPrice
     * @return self
     */
    function setPrice(float $itemPrice) : self {
        $this->itemPrice;
        return $this;
    }
    
    /**
     * 
     * @param object $itemImage
     * @return self
     */
    function setImage(object $itemImage) : self {
        $this->itemImage;
    }
    
    /**
     * 
     * @param Item ...$itemVarities
     * @return self
     */
    function setVarities(Item ...$itemVarities) : self {
        $rowId = 0;
        foreach ($itemVarities as $itemVarity) {
            $this->itemVarities[$rowId] = $itemVarity;
            $rowId++;
        }
    }
    
    /**
     * 
     * @param bool $hasSale
     * @return self
     */
    function setSale(bool $hasSale) : self {
        $this->hasSale = $hasSale;
    }
    
    function getCard() : string {
    	return "<div class='col-lg-4 col-md-6 special-grid " . $this->itemCategorie . "'>
                        <div class='gallery-single fix'>
                        <img height='" . $this->boxHeight . "px' width='" . $this->boxWidth . "px' src='data:image/png;base64," . '' /* $row['itemImage'] */ . "' class='img-fluid' alt='Image'>
                                <div class='why-text'>
                                    <h4>" . $this->itemName . "</h4>
                                    <p>" . $this->itemDescription . "</p>
                                    <h5>" . ($this->itemPrice == 0 ? "Kostenlos <a href='#' style='font-size:12px'>Herunterladen</a>" : $this->itemPrice) . "</h5>
                                </div>
                        </div>
                    </div>";
    }
    
    
}

